import React from 'react';
import Nav from "../components/main/Nav";
import SignUpBox from "../components/main/SignUpBox";
import IndexIntro from "../components/main/IndexIntro";

const Login = () => {
    const styles = {
        layout: {
            display: 'flex',
            height: '100%',
            overflow: 'hidden',
            alignItems: 'center',
            alignContent: 'center',
            justifyContent: 'center'
        }
    }

    return (
        <div>
            <Nav />
            <div style={styles.layout}>
                <IndexIntro />
                <SignUpBox />
            </div>
        </div>
    );
};

export default Index;
